// ===== SHOP DATA =====
let cart = [];
let total = 0;

// Reviews array
let reviews = [
    { stars: [], comments: [] }, // Product 0
    { stars: [], comments: [] }  // Product 1
    // Add more for each product
];

// ===== ADD TO CART WITH STOCK & SOLD OUT LOGIC =====
function addToCartWithStock(button, name, price, paypalLink) {
    let stockEl = button.parentElement.querySelector(".stock");
    let stock = parseInt(stockEl.dataset.stock);
    let soldOutNote = button.parentElement.querySelector(".sold-out-note");

    if (stock <= 0) {
        alert("Sorry, this item is sold out!");
        return;
    }

    stock--;
    stockEl.dataset.stock = stock;
    stockEl.textContent = stock > 0 ? "In stock: " + stock : "Sold Out";

    // Sold Out styling
    if (stock === 0) {
        button.disabled = true;
        button.textContent = "Sold Out";
        button.style.backgroundColor = "#ccc";
        soldOutNote.textContent = "This item is permanently retired â€” no restocks.";
        button.parentElement.style.opacity = 0.7; // Gray out product
    }

    addToCart(name, price, paypalLink);
}

// ===== ADD TO CART =====
function addToCart(name, price, paypalLink) {
    cart.push({ name, price, paypalLink });
    total += price;
    updateCart();
}

// ===== UPDATE CART =====
function updateCart() {
    let list = document.getElementById("cart-items");
    let totalText = document.getElementById("cart-total");
    let checkoutLink = document.getElementById("data:image/png;base64,");

    list.innerHTML = "";

    cart.forEach(item => {
        let li = document.createElement("li");
        li.textContent = item.name + " â€” $" + item.price.toFixed(2);
        list.appendChild(li);
    });

    totalText.textContent = "Total: $" + total.toFixed(2);

    if (cart.length > 0) {
        const totalAmount = total.toFixed(2);
        checkoutLink.href = `https://www.paypal.com/ncp/payment/SPPPHZBJ6HE7L${totalAmount}`;
        checkoutLink.href = "#";
    }
}

// ===== SEARCH =====
function searchProducts(text) {
    let products = document.querySelectorAll(".product");
    products.forEach(product => {
        let name = product.querySelector("h3").textContent.toLowerCase();
        product.style.display = name.includes(text.toLowerCase()) ? "block" : "none";
    });
}

// ===== RATINGS & REVIEWS =====
function addReview(button) {
    const productDivs = document.querySelectorAll(".product");
    let index = Array.from(productDivs).indexOf(button.parentElement);

    const input = button.parentElement.querySelector(".review-input");
    const text = input.value.trim();
    if (!text) { alert("Please write a review!"); return; }

    let star = prompt("Rate this product from 1 to 5 stars:");
    star = parseInt(star);
    if (isNaN(star) || star < 1 || star > 5) star = 5;

    reviews[index].stars.push(star);
    reviews[index].comments.push(text);

    updateRatingDisplay(index);

    input.value = "";
    alert("Thanks for your review!");
}

function updateRatingDisplay(index) {
    const productDivs = document.querySelectorAll(".product");
    const product = productDivs[index];
    const starsSpan = product.querySelector(".stars");
    const averageSpan = product.querySelector(".average");

    const arr = reviews[index].stars;
    if (arr.length === 0) {
        starsSpan.textContent = "â˜†â˜†â˜†â˜†â˜†";
        averageSpan.textContent = "(0)";
        return;
    }

    const avg = arr.reduce((a, b) => a + b, 0) / arr.length;
    const fullStars = "â˜…".repeat(Math.round(avg));
    const emptyStars = "â˜†".repeat(5 - Math.round(avg));
    starsSpan.textContent = fullStars + emptyStars;
    averageSpan.textContent = `(${arr.length} reviews)`;
}

// ===== INIT SOLD OUT ON PAGE LOAD =====
document.addEventListener("DOMContentLoaded", () => {
    const products = document.querySelectorAll(".product");
    products.forEach(product => {
        const stockEl = product.querySelector(".stock");
        const stock = parseInt(stockEl.dataset.stock);
        const button = product.querySelector("button");
        const soldOutNote = product.querySelector(".sold-out-note");

        if (stock === 0) {
            button.disabled = true;
            button.textContent = "Sold Out";
            button.style.backgroundColor = "#ccc";
            soldOutNote.textContent = "This item is permanently retired â€” no restocks.";
            product.style.opacity = 0.7;
        }
    });
});